import preview from 'part:sanity-plugin-icon-picker/preview';

export default {
  name: 'icons',
  title: 'Icons',
  type: 'object',
  fieldsets: [
    {
      title: 'Icons',
      name: 'iconsSet',
    },
  ],
  fields: [
    {
      name: 'icon',
      title: 'Icon',
      type: 'iconPicker',
      options: {
        providers: ['f7', 'fa', 'mdi', 'sa', 'hi', 'fi'],
        outputFormat: 'react',
      },
    },
    {
      name: 'url',
      title: 'URL',
      type: 'url',
      validation: (Rule) =>
        Rule.uri({
          scheme: ['http', 'https', 'mailto', 'tel'],
        }),
    },
  ],
  preview: {
    select: {
      provider: 'icon.provider',
      name: 'icon.name',
    },
    prepare(icon) {
      return {
        title: icon.provider,
        subtitle: icon.name,
        media: preview(icon),
      };
    },
  },
};

